import Link from 'next/link'

const Header = (props) => (
    <div>
        <h1>{props.name}</h1>
        <Link href="/">
          <a>Home</a>
        </Link>
        <style jsx>{`
      div {
        border-bottom: solid 1px lightgrey;
        padding-top: 2%;
        padding-left: 1%;
      }
      h1 {
          display: inline-block;
      }
      a {
          margin-left: 1%;
          font-size: 2rem;
      }
    `}</style>
    </div>
)

export default Header
